import { useNavigate } from "react-router-dom";
import { useAuth } from "./AuthContext";

const useProtectedRoute = () => {
  const navigate = useNavigate();
  const { currentUser } = useAuth();

  if (!currentUser) {
    navigate("/login");
  }
};
